import React from 'react';
import './Homepage.scss';
import LikeButton from '../../Components/LikeButton/LikeButton';

const typeJokes = [
  {
    title:'Adult Jokes',
    color: '#ff5b5b'
  },
  {
    title:'Dad Jokes',
    color: '#ff915b'
  },
  {
    title:'Christmas Jokes',
    color: '#ffbe5b'
  },
  {
    title:'Job Jokes',
    color: '#ffdf5b'
  },
  {
    title:'Birthday Jokes',
    color: '#8fe360'
  },
  {
    title:'Social Jokes',
    color: '#57e690'
  },
  {
    title:'Puns',
    color: '#57dbe6'
  },
  {
    title:'View all',
    color: '',
  }
]

const Homepage = () => {
  return (
    <div className="homepage">      
      <div className='container'>
        <div className='homepage__tab'>
          {
            typeJokes.map((element,index)=>(
              <div key={index} className={element.color!==''?'tab__item': 'tab__item view-all'} style={{backgroundColor: `${element.color}`}}>
                {element.title}
              </div>
            ))
          }
        </div>
      </div>
    </div>
  );
}

export default Homepage;
